either3.html.body:
Either3
以下のような、3つのうちのどれか？を表すデータ型です。
sealed abstract class Either3[A, B, C] extends Product with Serializable {
  // メソッド省略
}

object Either3 {
  final case class Left3[A, B, C](a: A) extends Either3[A, B, C]
  final case class Middle3[A, B, C](b: B) extends Either3[A, B, C]
  final case class Right3[A, B, C](c: C) extends Either3[A, B, C]

  // メソッド省略
}

それほど多く使われてるのは見かけません。
通常のプログラミングにおいては、同じようなデータ型だとしても
Either3を使うのではなく、わかりやすさのために専用のデータ型を作ったほうがいいと思います。

cord.html.body:
Cord
以下のような、Stringを内部に持ったTreeのようなデータ型です。
sealed abstract class Cord {
  // メソッド省略
}

object Cord {
  final class Leaf private(val s: String) extends Cord
  final class Branch private (
    val leftDepth: Int,
    val left: Cord,
    val right: Cord
  ) extends Cord
}

scalaz.Showなどで使われています。7.2以前は内部実装がFingerTreeでしたが、7.3から上記のようなものに置き換えられました。

